import React, { useEffect, useState } from 'react';
import { fetchData } from '../api'; // Import the API function to fetch data

const CategorizedData = ({ endpoint }) => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const getData = async () => {
      try {
        const result = await fetchData(endpoint); // Fetch data from the provided endpoint
        setData(result);
      } catch (err) {
        setError(err.message);
      }
    };
    getData();
  }, [endpoint]); // Update the data whenever the endpoint changes

  if (error) return <p>Error: {error}</p>; // Display error message if data fetching fails
  if (!data) return <p>Loading...</p>; // Show loading message while data is being fetched

  return (
    <div>
      <h2>{endpoint} Data</h2>
      <DataTable data={data} /> {/* Pass the data to DataTable component */}
    </div>
  );
};

const DataTable = ({ data }) => {
  if (!data || Object.keys(data).length === 0) return <p>No data available</p>;

  const keys = Object.keys(data); // Get all keys from the data

  return (
    <table>
      <thead>
        <tr>
          {keys.map((key, index) => (
            <th key={index}>{key}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {data[keys[0]].map((item, rowIndex) => (
          <tr key={rowIndex}>
            {keys.map((key, colIndex) => (
              <td key={colIndex}>{item[key]}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default CategorizedData;
